import React from 'react';
import Footer from '../components/Footer/Footer';
import Header from '../components/Header/Header';
import { 
	Homepage,
	H1,
	HomepageLink,
	ProjectContainer,
	ProjectContent,
	ProjectHeader,
	ProjectTags
} from './Project.styles';

const InProgress = () => {
    return(
        <div>
			<Homepage>
				<H1 id="logo"><HomepageLink href="index.html">Megan Chong</HomepageLink></H1>
			</Homepage>
			<Header height="15vh"/>
            <section class="project" id="project">
		        <ProjectContainer>
			        <ProjectContent>
				        <Project>Media and Design Co-op</Project>
				    <div class="tags">
					    <p class="ptags">Graphic Design, Web Development</p><br/>
				    </div>
				        <p class="description">Co-oping at Brigham and Women's hospital for Spring 2020 and Summer 1 semester. Stay tuned for updates!</p>
                </ProjectContent>
                    </ProjectContainer>
		    </section>
			<Footer/>
        </div>
    );
}

export default InProgress;
